import './App.css';
import Login from './components/login/Login';
import User from './components/user/User';
import { userState } from 'react';

const Users = [
  {
    nombre: "Luz",
    clave:23
  },
  {
    nombre: "Manuel",
    clave:26
  }
]

function App() {
  const [userData, setUserData] = userState(Users);
  return (
    <div className="App">
        <Login></Login>
        <User usuarios={userData}></User>
    </div>
  );
}

export default App;
